import { configureStore } from '@reduxjs/toolkit'

import currencies from '../currencies/slice'
import categories from "../categories/slice";
import cartList from '../cartList/slice'

export const store = configureStore({
  reducer: {
    currencies,
    categories,
    cartList
  },
})
